Описание:
Эмалированная кружка 250мл. удобна в применение.
 Эмалированная посуда не наносит вреда здоровью;
 Широкая цветовая гамма и возможность нанесения деколи позволяет предоставить покупателю широчайший выбор дизайна и оформления;
Эмалированная посуда гигиенична и проста в уходе;
На дне изделий без нержавеющего ободка допускаются «точки» – следы от иголок, на которые изделие ставится и обжигается в печи. На изделиях с ободком, таких следов нет, т.к. для обжига они ставятся вверх дном, а борт затем закрывается ободком из нержавеющей стали.
Подходит для использования на всех типах плит, кроме индукционных . Подходит для мытья в посудомоечной машине.

